Voor driebackpackers lijkt hun droom uit te komen; ze brengen een week door bij het mooiste koraalrif ter wereld met hun eigen jacht. Als hun boot omslaat, en ze aan hun lot overgelaten worden op het gekantelde jacht, verandert deze droom echter in een ware nachtmerrie. Wat moeten ze nu? Op het jacht, dat ieder moment kan zinken, blijven? Of zwemmend op zoek gaan naar land? Ze besluiten het laatste te doen. Maar als ze dicht in de buurt van de kust zijn, zien ze een grote vin zwemmen. De vrienden realiseren zich dat ze opgewacht worden door een grote witte haai. Zullen ze de kust levend bereiken?

